import {useEffect, useState} from "react";

const Home = () => {
    const [blogs, setBlogs] = useState([{}]);

    useEffect(() => {
        fetch('/api/discover', {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(res => res.json())
            .then(res => {console.log(res)})
            .then(res => {setBlogs(res)})
    },[])

    //console.log(JSON.stringify(blogs))

    return <>
        
    </>
}


export default Home;
